from django.db import modelsfrom apps.account.models import Account, BranchModelclass ServiceModel(models.Model):    TYPES = (        ("service", "service"),        ("procedure", "procedure"),    )    doctors = models.ManyToManyField(Account, related_name="services")    rooms = models.ManyToManyField('RoomModel', related_name="procedure_rooms")    service_name = models.CharField(max_length=255)    type = models.CharField(choices=TYPES, default="service", max_length=50)    price = models.IntegerField()    created_by = models.ForeignKey(Account, related_name="logus_service", on_delete=models.SET_NULL, null=True)    created_at = models.DateTimeField(auto_now_add=True)    modified_at = models.DateTimeField(auto_now=True)    modified_by = models.ForeignKey(Account, related_name="modf_logus_service", on_delete=models.SET_NULL, null=True)    branch = models.ForeignKey(BranchModel, on_delete=models.SET_NULL, null=True, blank=True)    def __str__(self):        return f"{self.service_name} - {self.price}"